import React, { Component } from 'react';
class Recipe extends Component {
  render() {
    console.log(this.props.recipe);
    const {image_url,title,source_url,publisher,recipe_id} = this.props.recipe;
    return (
        <React.Fragment>
          <div className="col-10 max-auto col-md-6 col-lg-4 my-3">
            <div className="card">
              <img src={image_url} alt="" className="img-cart-top" style={{height:"14rem"}} />
              <div className="card-body text-capitalize">
                <h6>{title}</h6>
                <h6 className="text-warning text-slanted">Provided by {publisher}</h6>
              </div>
              <div className="cart-footer">
                <button type="button">Detail</button>
              </div>
            </div>

          </div>
        </React.Fragment>
      );
  }
}
export default Recipe;
